import React from "react";

const Login = () => {
  return (
    <>
      <div className="header">
        <h3>Login</h3>
        <h3>Register</h3>
      </div>
      <div>
        <h1>This is Login Page</h1>
      </div>
    </>
  );
};

export default Login;
